import Fotos from './Fotos';
import MasVideos from './MasVideos';
import Uri from './Uri';
import Videos from './Videos';

const Homepage = () => {
  return (
    <>
      <div className="Uri container">
        <Uri />
      </div>
      <div className="Uri container">
        <Fotos />
      </div>
      <div className="Uri container">
        <Videos />
      </div>
      <div className="Uri container">
        <MasVideos />
      </div>
    </>
  );
};
export default Homepage;
